import React from 'react';
import ProductCard from './ProductCard'; // Ensure this import is correct

const ProductList = () => {
  // 1. Data stays inside or outside the function
  const products = [
    { id: 1, name: "Gold Necklace", price: 5000, image: "link_to_image" },
    { id: 2, name: "Diamond Ring", price: 10000, image: "link_to_image" },
  ];

  // 2. The 'return' MUST be inside this function block { ... }
  return (
    <div className="product-grid">
      {products.map(product => (
        <ProductCard key={product.id} product={product} />
      ))}
    </div>
  );
};

// 3. Don't forget to export it!
export default ProductList;
